import React from "react";
import {
  Button,
  Divider,
  Typography,
  Card,
  Box,
  AvatarTable,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  RadioGroup,
  FormControlLabel,
  Radio,
  TextField,
  FormGroup,
  Checkbox,
} from "@mui/material";
import { useState } from "react";
import QuestionCreator from "./QuestionCreator";

const TestCreator = () => {
  const [questionList, setQuestionList] = useState([]);
  const onAddBtnClick = (event) => {
    setQuestionList(
      questionList.concat(<QuestionCreator key={questionList.length} />)
    );
  };

  return (
    <Box
      sx={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        flexDirection: "column",
        width: "100%",
        height: "100%",
        mt: 3,
      }}
    >
      <Typography variant="h5" sx={{ fontWeight: 500, mb: 3 }}>
        Kreator Testu
      </Typography>
      <Button onClick={onAddBtnClick}>Click</Button>
      <Divider sx={{ width: "100%" }}></Divider>
    </Box>
  );
};

export default TestCreator;
